import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Blog.css';

class Blog extends React.Component {
  render() {
    return (
      <div className="blog-container">
        <h1>Blog</h1>
        <div className="blog-list">
          <div className="blog-card">
            <h2>Blog Post 1</h2>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam id ligula purus. Duis consequat mi id erat tincidunt, at dapibus justo feugiat.</p>
            <Link to="/blog/post1" className="read-more-link">Read More</Link>
          </div>
          <div className="blog-card">
            <h2>Blog Post 2</h2>
            <p>Sed finibus lorem eu nunc dignissim ullamcorper. Nullam ultrices arcu nec leo iaculis, nec feugiat mauris volutpat.</p>
            <Link to="/blog/post2" className="read-more-link">Read More</Link>
          </div>
          <div className="blog-card">
            <h2>Blog Post 3</h2>
            <p>Vivamus feugiat arcu ut velit convallis, non eleifend sem lobortis. In at justo eu libero convallis faucibus.</p>
            <Link to="/blog/post3" className="read-more-link">Read More</Link>
          </div>
        </div>
      </div>
    );
  }
}

export default Blog;
